import assert from 'node:assert/strict';
import { afterEach, describe, it, mock } from 'node:test';

import {
  SessionService,
  createSessionService,
  __setSessionServiceTestOverrides,
} from './session-service.js';

describe('SessionService', () => {
  afterEach(() => {
    mock.restoreAll();
    __setSessionServiceTestOverrides();
  });

  it('aggregates in-memory sessions without tmux availability', async () => {
    const now = Date.now();

    const listSessionsMock = mock.fn(() => [
      {
        org: 'acme',
        repo: 'demo',
        branch: 'feature/login',
        idle: false,
        lastActivityAt: now - 1,
      } as unknown,
      {
        org: 'acme',
        repo: 'demo',
        branch: 'feature/login',
        idle: true,
        lastActivityAt: new Date(now),
      } as unknown,
    ]);

    const makeKeyMock = mock.fn((org: string, repo: string, branch: string) => `${org}/${repo}/${branch}`);
    const detectMock = mock.fn(async () => ({ available: false, version: null }));
    const isAvailableMock = mock.fn(() => false);

    __setSessionServiceTestOverrides({
      listActiveSessions: listSessionsMock,
      makeSessionKey: makeKeyMock,
      detectTmux: detectMock,
      isTmuxAvailable: isAvailableMock,
    });

    const service = new SessionService('/work');
    const sessions = await service.listSessions();

    assert.equal(sessions.length, 1);
    const [session] = sessions;
    assert.ok(session);
    assert.equal(session.org, 'acme');
    assert.equal(session.repo, 'demo');
    assert.equal(session.branch, 'feature/login');
    assert.equal(session.idle, false);
    assert.equal(typeof session.lastActivityAt, 'string');
  });

  it('includes tmux sessions when available', async () => {
    const listSessionsMock = mock.fn(() => []);
    const makeKeyMock = mock.fn((org: string, repo: string, branch: string) => `${org}/${repo}/${branch}`);
    const detectMock = mock.fn(async () => ({ available: true, version: '3.3' }));
    const isAvailableMock = mock.fn(() => true);
    const runTmuxMock = mock.fn(async () => ({
      stdout: 'tw-acme--demo--feature-login\nrandom-entry\n',
      stderr: '',
    }));
    const discoverMock = mock.fn(async () => ({
      acme: {
        demo: {
          branches: ['main', 'feature/login'],
          initCommand: '',
        },
      },
    }));

    __setSessionServiceTestOverrides({
      listActiveSessions: listSessionsMock,
      makeSessionKey: makeKeyMock,
      detectTmux: detectMock,
      isTmuxAvailable: isAvailableMock,
      runTmux: runTmuxMock,
      discoverRepositories: discoverMock,
    });

    const service = createSessionService('/work');
    const sessions = await service.listSessions();

    assert.equal(sessions.length, 1);
    const [session] = sessions;
    assert.ok(session);
    assert.equal(session.org, 'acme');
    assert.equal(session.repo, 'demo');
    assert.equal(session.branch, 'feature/login');
    assert.equal(session.idle, false);
    assert.equal(session.lastActivityAt, null);
  });
});

import { discoverRepositories } from '../repositories/repository-repository.js';
import {
  buildSanitisedWorktreeLookup,
  detectTmux,
  isTmuxAvailable,
  parseTmuxSessionName,
  runTmux,
} from '../core/tmux.js';
import { listActiveSessions, makeSessionKey } from '../core/terminal-sessions.js';

export interface SessionInfo {
  org: string;
  repo: string;
  branch: string;
  idle: boolean;
  lastActivityAt: string | null;
}

type SessionServiceDependencyOverrides = Partial<{
  discoverRepositories: typeof discoverRepositories;
  buildSanitisedWorktreeLookup: typeof buildSanitisedWorktreeLookup;
  detectTmux: typeof detectTmux;
  isTmuxAvailable: typeof isTmuxAvailable;
  parseTmuxSessionName: typeof parseTmuxSessionName;
  runTmux: typeof runTmux;
  listActiveSessions: typeof listActiveSessions;
  makeSessionKey: typeof makeSessionKey;
}>;

const sessionServiceDependencies = {
  discoverRepositories,
  buildSanitisedWorktreeLookup,
  detectTmux,
  isTmuxAvailable,
  parseTmuxSessionName,
  runTmux,
  listActiveSessions,
  makeSessionKey,
} as const;

let sessionServiceTestOverrides: SessionServiceDependencyOverrides | null = null;

function resolveSessionServiceDependency<K extends keyof typeof sessionServiceDependencies>(
  key: K
): (typeof sessionServiceDependencies)[K] {
  const overrides = sessionServiceTestOverrides || {};
  const override = overrides[key];
  if (override) {
    return override as (typeof sessionServiceDependencies)[K];
  }
  return sessionServiceDependencies[key];
}

export function __setSessionServiceTestOverrides(overrides?: SessionServiceDependencyOverrides): void {
  sessionServiceTestOverrides = overrides ?? null;
}

/**
 * Type guard for finite numbers
 */
function isFiniteNumber(value: unknown): value is number {
  return typeof value === 'number' && Number.isFinite(value);
}

/**
 * Service for session discovery and management
 */
export class SessionService {
  constructor(private readonly workdir: string) {}

  /**
   * Lists all active terminal sessions, including both in-memory and orphaned tmux sessions
   * @returns List of session information
   */
  async listSessions(): Promise<SessionInfo[]> {
    const sessionLookup = new Map<string, {
      org: string;
      repo: string;
      branch: string;
      idle: boolean;
      lastActivityAtMs: number | null;
    }>();

    const listSessionsFn = resolveSessionServiceDependency('listActiveSessions');
    const makeKey = resolveSessionServiceDependency('makeSessionKey');

    // Gather in-memory sessions
    listSessionsFn().forEach((session) => {
      if (!session || !session.org || !session.repo || !session.branch) {
        return;
      }
      const key = makeKey(session.org, session.repo, session.branch);
      const lastActivityAtMs =
        typeof session.lastActivityAt === 'number'
          ? session.lastActivityAt
          : session.lastActivityAt instanceof Date
            ? session.lastActivityAt.getTime()
            : null;
      const idle = Boolean(session.idle);
      const existing = sessionLookup.get(key);
      if (!existing) {
        sessionLookup.set(key, {
          org: session.org,
          repo: session.repo,
          branch: session.branch,
          idle,
          lastActivityAtMs,
        });
        return;
      }
      existing.idle = existing.idle && idle;
      if (
        isFiniteNumber(lastActivityAtMs) &&
        (!isFiniteNumber(existing.lastActivityAtMs) || lastActivityAtMs > existing.lastActivityAtMs)
      ) {
        existing.lastActivityAtMs = lastActivityAtMs;
      }
    });

    // Discover orphaned tmux sessions
    const detect = resolveSessionServiceDependency('detectTmux');
    const tmuxAvailable = resolveSessionServiceDependency('isTmuxAvailable');

    await detect();
    if (tmuxAvailable()) {
      const tmuxSessions = await this.discoverTmuxSessions();

      if (tmuxSessions.length > 0) {
        let lookup;
        try {
          const repositoryDiscovery = resolveSessionServiceDependency('discoverRepositories');
          const buildLookup = resolveSessionServiceDependency('buildSanitisedWorktreeLookup');
          const structure = await repositoryDiscovery(this.workdir);
          lookup = buildLookup(structure);
        } catch (error: unknown) {
          lookup = new Map();
        }

        tmuxSessions.forEach((parsed) => {
          const sanitisedKey = `${parsed.org}--${parsed.repo}--${parsed.branch}`;
          const actual = lookup.get(sanitisedKey);
          if (!actual) {
            return;
          }
          const key = makeSessionKey(actual.org, actual.repo, actual.branch);
          if (sessionLookup.has(key)) {
            return;
          }
          sessionLookup.set(key, {
            org: actual.org,
            repo: actual.repo,
            branch: actual.branch,
            idle: false,
            lastActivityAtMs: null,
          });
        });
      }
    }

    // Convert to output format
    return Array.from(sessionLookup.values()).map((entry) => ({
      org: entry.org,
      repo: entry.repo,
      branch: entry.branch,
      idle: Boolean(entry.idle),
      lastActivityAt: isFiniteNumber(entry.lastActivityAtMs)
        ? new Date(entry.lastActivityAtMs).toISOString()
        : null,
    }));
  }

  /**
   * Discovers tmux sessions
   * @returns List of parsed tmux session names
   */
  private async discoverTmuxSessions(): Promise<Array<{ org: string; repo: string; branch: string }>> {
    let stdout = '';
    const run = resolveSessionServiceDependency('runTmux');
    try {
      const result = await run(['list-sessions', '-F', '#S']);
      stdout = result && typeof result.stdout === 'string' ? result.stdout : '';
    } catch (error: unknown) {
      const err = error as { code?: number };
      if (typeof err.code === 'number') {
        stdout = '';
      } else {
        console.error('Failed to list tmux sessions', error);
        stdout = '';
      }
    }

    const names = stdout
      .split('\n')
      .map((line) => line.trim())
      .filter(Boolean);

    const parse = resolveSessionServiceDependency('parseTmuxSessionName');

    return names
      .map((name) => parse(name))
      .filter((parsed): parsed is NonNullable<typeof parsed> => parsed !== null);
  }
}

/**
 * Creates a session service instance
 * @param workdir - Work directory root
 * @returns SessionService instance
 */
export function createSessionService(workdir: string): SessionService {
  return new SessionService(workdir);
}

import fs from 'node:fs/promises';
import path from 'node:path';
import { executeGitCommand, extractGitErrorMessage, GIT_BUFFER_SIZES } from './git-repository.js';
import { listWorktrees } from './worktree-repository.js';
import { parseRepositoryUrl } from '../domain/index.js';
import { getRepositoryInitCommand } from '../core/repository-config.js';
import { normaliseInitCommand, setRepositoryInitCommand } from '../core/repository-config.js';

export interface RepositoryPaths {
  repoRoot: string;
  repositoryPath: string;
}

export interface CloneResult {
  org: string;
  repo: string;
}

export interface CloneOptions {
  initCommand?: string;
}

export interface RepositoriesMap {
  [org: string]: {
    [repo: string]: {
      branches: string[];
      initCommand: string;
    };
  };
}

type RepositoryRepositoryDependencyOverrides = Partial<{
  executeGitCommand: typeof executeGitCommand;
  listWorktrees: typeof listWorktrees;
  getRepositoryInitCommand: typeof getRepositoryInitCommand;
  normaliseInitCommand: typeof normaliseInitCommand;
  setRepositoryInitCommand: typeof setRepositoryInitCommand;
}>;

const repositoryRepositoryDependencies = {
  executeGitCommand,
  listWorktrees,
  getRepositoryInitCommand,
  normaliseInitCommand,
  setRepositoryInitCommand,
} as const;

let repositoryRepositoryTestOverrides: RepositoryRepositoryDependencyOverrides | null = null;

function resolveRepositoryRepositoryDependency<K extends keyof typeof repositoryRepositoryDependencies>(
  key: K
): (typeof repositoryRepositoryDependencies)[K] {
  const overrides = repositoryRepositoryTestOverrides || {};
  const override = overrides[key];
  if (override) {
    return override as (typeof repositoryRepositoryDependencies)[K];
  }
  return repositoryRepositoryDependencies[key];
}

export function __setRepositoryRepositoryTestOverrides(
  overrides?: RepositoryRepositoryDependencyOverrides
): void {
  repositoryRepositoryTestOverrides = overrides ?? null;
}

/**
 * Ensures a repository exists and returns its paths
 * @param workdir - Work directory root
 * @param org - Organization name
 * @param repo - Repository name
 * @returns Repository paths
 * @throws {Error} If repository doesn't exist or is invalid
 */
export async function ensureRepository(workdir: string, org: string, repo: string): Promise<RepositoryPaths> {
  if (!org || !repo) {
    throw new Error('Repository identifier is incomplete');
  }

  const repoRoot = path.join(workdir, org, repo);
  const repositoryPath = path.join(repoRoot, 'repository');

  let stats;
  try {
    stats = await fs.stat(repositoryPath);
  } catch (error: unknown) {
    const err = error as { code?: string; message?: string };
    if (err && err.code === 'ENOENT') {
      throw new Error(`Repository not found for ${org}/${repo}`);
    }
    throw new Error(`Unable to access repository ${org}/${repo}: ${err.message}`);
  }

  if (!stats.isDirectory()) {
    throw new Error(`Repository path is not a directory: ${repositoryPath}`);
  }

  return { repoRoot, repositoryPath };
}

/**
 * Clones a repository
 * @param workdir - Work directory root
 * @param repositoryUrl - Git repository URL
 * @param options - Options
 * @returns Clone result with org and repo
 * @throws {Error} If clone fails or repository already exists
 */
export async function cloneRepository(
  workdir: string,
  repositoryUrl: string,
  options: CloneOptions = {}
): Promise<CloneResult> {
  const { org, repo, url } = parseRepositoryUrl(repositoryUrl);
  const repoRoot = path.join(workdir, org, repo);
  const repositoryPath = path.join(repoRoot, 'repository');

  await fs.mkdir(repoRoot, { recursive: true });

  try {
    const stats = await fs.stat(repositoryPath);
    if (stats.isDirectory()) {
      throw new Error(`Repository already exists for ${org}/${repo}`);
    }
    throw new Error(`Cannot create repository at ${repositoryPath}`);
  } catch (error: unknown) {
    const err = error as { code?: string };
    if (!err || err.code !== 'ENOENT') {
      throw error;
    }
  }

  try {
    const execGit = resolveRepositoryRepositoryDependency('executeGitCommand');
    await execGit(['clone', url, repositoryPath], {
      maxBuffer: GIT_BUFFER_SIZES.MEDIUM,
    });
  } catch (error: unknown) {
    const message = extractGitErrorMessage(error);
    throw new Error(`Failed to clone repository: ${message}`);
  }

  if (options && Object.prototype.hasOwnProperty.call(options, 'initCommand')) {
    const normalise = resolveRepositoryRepositoryDependency('normaliseInitCommand');
    const initCommand = normalise(options.initCommand);
    try {
      const setInit = resolveRepositoryRepositoryDependency('setRepositoryInitCommand');
      await setInit(repoRoot, initCommand);
    } catch (error: unknown) {
      const err = error as { message?: string };
      throw new Error(`Failed to persist repository settings: ${err?.message || error}`);
    }
  }

  return { org, repo };
}

/**
 * Discovers all repositories in the work directory
 * @param workdir - Work directory root
 * @returns Nested object: {org: {repo: {branches, initCommand}}}
 */
export async function discoverRepositories(workdir: string): Promise<RepositoriesMap> {
  const result: RepositoriesMap = {};
  const listWorktreesFn = resolveRepositoryRepositoryDependency('listWorktrees');
  const getInitCommand = resolveRepositoryRepositoryDependency('getRepositoryInitCommand');

  let organisations;
  try {
    organisations = await fs.readdir(workdir, { withFileTypes: true });
  } catch (error: unknown) {
    const err = error as { code?: string };
    if (err.code === 'ENOENT') {
      return result;
    }
    throw error;
  }

  for (const orgEntry of organisations) {
    if (!orgEntry.isDirectory()) {
      continue;
    }

    const orgName = orgEntry.name;
    const orgPath = path.join(workdir, orgName);
    let repoEntries;

    try {
      repoEntries = await fs.readdir(orgPath, { withFileTypes: true });
    } catch {
      continue;
    }

    for (const repoEntry of repoEntries) {
      if (!repoEntry.isDirectory()) {
        continue;
      }

      const repoName = repoEntry.name;
      const repoRoot = path.join(orgPath, repoName);
      const repositoryPath = path.join(repoRoot, 'repository');

      try {
        const stats = await fs.stat(repositoryPath);
        if (!stats.isDirectory()) {
          continue;
        }
      } catch {
        continue;
      }

      const worktrees = await listWorktreesFn(repositoryPath);
      const branches = Array.from(
        new Set(
          worktrees
            .map((entry) => entry.branch)
            .filter((branch): branch is string => typeof branch === 'string' && branch.length > 0)
        )
      );

      let initCommand = '';
      try {
        initCommand = await getInitCommand(repoRoot);
      } catch (error: unknown) {
        const err = error as { message?: string };
        console.warn(
          `[agentrix] Failed to load repository config for ${orgName}/${repoName}:`,
          err?.message || error
        );
        initCommand = '';
      }

      if (!result[orgName]) {
        result[orgName] = {};
      }
      result[orgName]![repoName] = { branches, initCommand };
    }
  }

  return result;
}

import { promisify } from 'node:util';
import { execFile } from 'node:child_process';

import { TMUX_BIN, TMUX_SESSION_PREFIX } from '../config/constants.js';

const execFileAsync = promisify(execFile);

let tmuxAvailable = false;
let tmuxVersion: string | null = null;
let tmuxDetection: Promise<{ available: boolean; version: string | null }> | undefined;

export interface TmuxDetectionResult {
  available: boolean;
  version: string | null;
}

export interface TmuxSessionInfo {
  org: string;
  repo: string;
  branch: string;
}

export interface TmuxRunOptions {
  cwd?: string;
  env?: NodeJS.ProcessEnv;
  maxBuffer?: number;
}

export async function detectTmux(): Promise<TmuxDetectionResult> {
  if (!tmuxDetection) {
    tmuxDetection = (async () => {
      try {
        const { stdout } = await execFileAsync(TMUX_BIN, ['-V'], { maxBuffer: 1024 * 1024 });
        tmuxAvailable = true;
        tmuxVersion = stdout ? stdout.trim() : null;
      } catch {
        tmuxAvailable = false;
        tmuxVersion = null;
      }
      return { available: tmuxAvailable, version: tmuxVersion };
    })();
  }
  return tmuxDetection;
}

export function isTmuxAvailable(): boolean {
  return tmuxAvailable;
}

export async function runTmux(args: string[], options: TmuxRunOptions = {}): Promise<{ stdout: string; stderr: string }> {
  return execFileAsync(TMUX_BIN, args, { maxBuffer: 1024 * 1024, ...options });
}

export function sanitiseTmuxComponent(value: unknown, fallback: string): string {
  if (typeof value !== 'string') {
    return fallback;
  }
  const trimmed = value.trim();
  if (!trimmed) {
    return fallback;
  }
  const cleaned = trimmed
    .replace(/\s+/g, '-')
    .replace(/[^A-Za-z0-9._-]/g, '-')
    .replace(/-+/g, '-')
    .replace(/^-|-$/g, '');
  return cleaned || fallback;
}

export function makeTmuxSessionName(org: string, repo: string, branch: string): string {
  const orgPart = sanitiseTmuxComponent(org, 'org');
  const repoPart = sanitiseTmuxComponent(repo, 'repo');
  const branchPart = sanitiseTmuxComponent(branch, 'branch');
  return `${TMUX_SESSION_PREFIX}${orgPart}--${repoPart}--${branchPart}`;
}

export function parseTmuxSessionName(sessionName: string): TmuxSessionInfo | null {
  if (typeof sessionName !== 'string' || !sessionName.startsWith(TMUX_SESSION_PREFIX)) {
    return null;
  }
  const remainder = sessionName.slice(TMUX_SESSION_PREFIX.length);
  const parts = remainder.split('--');
  if (parts.length !== 3) {
    return null;
  }
  const [org, repo, branch] = parts;
  if (!org || !repo || !branch) {
    return null;
  }
  return { org, repo, branch };
}

export function makeSanitisedSessionKey(org: string, repo: string, branch: string): string {
  const orgPart = sanitiseTmuxComponent(org, 'org');
  const repoPart = sanitiseTmuxComponent(repo, 'repo');
  const branchPart = sanitiseTmuxComponent(branch, 'branch');
  return `${orgPart}--${repoPart}--${branchPart}`;
}

export function buildSanitisedWorktreeLookup(structure: unknown): Map<string, TmuxSessionInfo> {
  const map = new Map<string, TmuxSessionInfo>();
  const struct = structure as Record<string, Record<string, { branches?: string[] } | unknown>>;
  Object.entries(struct || {}).forEach(([org, repos]) => {
    const repoEntries = repos && typeof repos === 'object' ? repos : {};
    Object.entries(repoEntries).forEach(([repo, info]) => {
      const infoObj = info as { branches?: string[] };
      const branchList = Array.isArray(infoObj?.branches)
        ? infoObj.branches
        : Array.isArray(info)
          ? (info as string[])
          : [];
      branchList.forEach((branch) => {
        if (!branch) {
          return;
        }
        const key = makeSanitisedSessionKey(org, repo, branch);
        if (!map.has(key)) {
          map.set(key, { org, repo, branch });
        }
      });
    });
  });
  return map;
}

function tmuxTarget(sessionName: string): string {
  return `=${sessionName}`;
}

export async function tmuxHasSession(sessionName: string): Promise<boolean> {
  try {
    await runTmux(['has-session', '-t', tmuxTarget(sessionName)]);
    return true;
  } catch (error: unknown) {
    const err = error as { code?: number };
    if (typeof err.code === 'number') {
      return false;
    }
    throw error;
  }
}

export async function tmuxKillSession(sessionName: string): Promise<void> {
  try {
    await runTmux(['kill-session', '-t', tmuxTarget(sessionName)]);
  } catch (error: unknown) {
    const err = error as { code?: number };
    if (typeof err.code === 'number') {
      return;
    }
    throw error;
  }
}

export async function tmuxKillSessionsForRepository(
  org: string,
  repo: string,
  branches: string[]
): Promise<void> {
  if (!org || !repo || !Array.isArray(branches) || branches.length === 0) {
    return;
  }
  await detectTmux();
  if (!isTmuxAvailable()) {
    return;
  }
  const tasks = branches
    .filter((branch) => typeof branch === 'string' && branch.length > 0)
    .map(async (branch) => {
      const tmuxSessionName = makeTmuxSessionName(org, repo, branch);
      try {
        await tmuxKillSession(tmuxSessionName);
      } catch (error: unknown) {
        const err = error as { message?: string };
        console.warn(
          `[agentrix] Failed to kill tmux session ${tmuxSessionName}:`,
          err?.message || error
        );
      }
    });
  if (tasks.length === 0) {
    return;
  }
  await Promise.allSettled(tasks);
}

import { randomUUID } from 'node:crypto';
import pty from 'node-pty';
import type { TerminalSession } from '../types/terminal.js';

import { MAX_TERMINAL_BUFFER, TMUX_BIN } from '../config/constants.js';
import { getWorktreePath } from './git.js';
import {
  detectTmux,
  isTmuxAvailable,
  makeTmuxSessionName,
  tmuxHasSession,
} from './tmux.js';
import { emitSessionsUpdate } from './event-bus.js';

const IDLE_TIMEOUT_MS = 90 * 1000;
const IDLE_SWEEP_INTERVAL_MS = 5 * 1000;

const terminalSessions = new Map<string, Map<string, TerminalSession>>();
const terminalSessionsById = new Map<string, TerminalSession>();
let idleMonitorTimer: NodeJS.Timeout | null = null;

function ensureIdleMonitor() {
  if (idleMonitorTimer) {
    return;
  }
  idleMonitorTimer = setInterval(runIdleSweep, IDLE_SWEEP_INTERVAL_MS);
}

function stopIdleMonitorIfInactive() {
  if (!idleMonitorTimer) {
    return;
  }
  if (terminalSessionsById.size === 0) {
    clearInterval(idleMonitorTimer);
    idleMonitorTimer = null;
  }
}

function getSessionBucket(key: string, create: boolean = false): Map<string, TerminalSession> | undefined {
  let bucket = terminalSessions.get(key);
  if (!bucket && create) {
    bucket = new Map();
    terminalSessions.set(key, bucket);
  }
  return bucket;
}

function addSession(session: TerminalSession): void {
  const bucket = getSessionBucket(session.key, true)!;
  bucket.set(session.id, session);
  terminalSessionsById.set(session.id, session);
  ensureIdleMonitor();
}

function removeSession(session: TerminalSession): void {
  const bucket = terminalSessions.get(session.key);
  if (bucket) {
    bucket.delete(session.id);
    if (bucket.size === 0) {
      terminalSessions.delete(session.key);
    }
  }
  terminalSessionsById.delete(session.id);
  stopIdleMonitorIfInactive();
}

function listSessionsForKey(key: string): TerminalSession[] {
  const bucket = terminalSessions.get(key);
  if (!bucket) {
    return [];
  }
  return Array.from(bucket.values());
}

function normaliseSessionInput(input: string | Buffer): string {
  if (typeof input === 'string') {
    return input;
  }
  if (Buffer.isBuffer(input)) {
    return input.toString('utf8');
  }
  return '';
}

function flushPendingInputs(session: TerminalSession): void {
  if (!session || !Array.isArray(session.pendingInputs) || session.pendingInputs.length === 0) {
    return;
  }
  const inputs = session.pendingInputs.slice();
  session.pendingInputs.length = 0;
  inputs.forEach((value) => {
    if (!value) {
      return;
    }
    try {
      session.process.write(value);
    } catch {
      // ignore write errors; process lifecycle handlers will surface issues elsewhere
    }
  });
}

function noteSessionActivity(session: TerminalSession): boolean {
  if (!session || session.closed) {
    return false;
  }
  const now = Date.now();
  session.lastActivityAt = now;
  if (session.idle) {
    session.idle = false;
    return true;
  }
  return false;
}

function markSessionReady(session: TerminalSession): void {
  if (!session || session.ready) {
    return;
  }
  session.ready = true;
  if (session.readyTimer) {
    clearTimeout(session.readyTimer);
    session.readyTimer = null;
  }
  flushPendingInputs(session);
}

export function queueSessionInput(session: TerminalSession, input: string | Buffer): void {
  if (!session || session.closed) {
    return;
  }
  if (!Array.isArray(session.pendingInputs)) {
    session.pendingInputs = [];
  }
  const value = normaliseSessionInput(input);
  if (!value) {
    return;
  }
  const becameActive = noteSessionActivity(session);
  if (session.ready) {
    try {
      session.process.write(value);
    } catch {
      // ignore write errors
    }
  } else {
    session.pendingInputs.push(value);
  }
  if (becameActive) {
    emitSessionsUpdate(serialiseSessions(listActiveSessions()));
  }
}

function trimLogBuffer(log: string): string {
  if (log.length <= MAX_TERMINAL_BUFFER) {
    return log;
  }
  return log.slice(log.length - MAX_TERMINAL_BUFFER);
}

function broadcast(session: TerminalSession, event: string, payload: Record<string, unknown>): void {
  const message = JSON.stringify({ type: event, ...payload });
  session.watchers.forEach((watcher) => {
    const socket = watcher.socket;
    if (!socket || socket.readyState !== 1) {
      try {
        socket?.terminate();
      } catch {
        // ignore terminate errors
      }
      session.watchers.delete(watcher);
      return;
    }

    try {
      socket.send(message);
    } catch {
      try {
        socket.terminate();
      } catch {
        // ignore
      }
      session.watchers.delete(watcher);
    }
  });
}

function handleSessionOutput(session: TerminalSession, chunk: string | Buffer): void {
  markSessionReady(session);
  const becameActive = noteSessionActivity(session);
  const text = typeof chunk === 'string' ? chunk : chunk.toString('utf8');
  session.log = trimLogBuffer((session.log || '') + text);
  broadcast(session, 'output', { chunk: text });
  if (becameActive) {
    emitSessionsUpdate(serialiseSessions(listActiveSessions()));
  }
}

function serialiseSessions(sessions: TerminalSession[]): unknown[] {
  return sessions.map((session) => {
    const lastActivityAtMs =
      typeof session.lastActivityAt === 'number'
        ? session.lastActivityAt
        : session.lastActivityAt instanceof Date
        ? session.lastActivityAt.getTime()
        : null;
    return {
      id: session.id,
      org: session.org,
      repo: session.repo,
      branch: session.branch,
      usingTmux: session.usingTmux,
      idle: Boolean(session.idle),
      lastActivityAt: lastActivityAtMs ? new Date(lastActivityAtMs).toISOString() : null,
    };
  });
}

function runIdleSweep() {
  if (terminalSessionsById.size === 0) {
    stopIdleMonitorIfInactive();
    return;
  }
  const now = Date.now();
  let changed = false;

  terminalSessionsById.forEach((session) => {
    if (!session || session.closed) {
      return;
    }
    const last =
      typeof session.lastActivityAt === 'number'
        ? session.lastActivityAt
        : session.lastActivityAt instanceof Date
        ? session.lastActivityAt.getTime()
        : null;
    if (!last) {
      session.lastActivityAt = now;
      return;
    }
    if (!session.idle && now - last >= IDLE_TIMEOUT_MS) {
      session.idle = true;
      changed = true;
    }
  });

  if (changed) {
    emitSessionsUpdate(serialiseSessions(listActiveSessions()));
  }
}

function handleSessionExit(session: TerminalSession, code: number, signal: string, error?: Error): void {
  if (session.closed) {
    return;
  }
  session.closed = true;
  session.exitCode = code;
  session.exitSignal = signal;
  session.exitError = error ? error.message : undefined;
  if (session.readyTimer) {
    clearTimeout(session.readyTimer);
    session.readyTimer = null;
  }
  if (Array.isArray(session.pendingInputs)) {
    session.pendingInputs.length = 0;
  }
  broadcast(session, 'exit', {
    code: session.exitCode,
    signal: session.exitSignal,
    error: session.exitError,
  });
  session.watchers.forEach((watcher) => {
    if (watcher.socket && watcher.socket.readyState === 1) {
      try {
        watcher.socket.close();
      } catch {
        // ignore
      }
    }
  });
  session.watchers.clear();
  removeSession(session);
  if (session.waiters) {
    session.waiters.forEach((resolve) => resolve());
    session.waiters = [];
  }
  emitSessionsUpdate(serialiseSessions(listActiveSessions()));
}

export function makeSessionKey(org: string, repo: string, branch: string): string {
  return `${org}::${repo}::${branch}`;
}

function determineShellArgs(shellCommand: string): string[] {
  if (!shellCommand) {
    return [];
  }
  const name = shellCommand.split('/').pop();
  if (name === 'bash' || name === 'zsh' || name === 'fish') {
    return ['-il'];
  }
  return [];
}

async function terminateSession(session: TerminalSession, options: { signal?: string; forceAfter?: number } = {}): Promise<void> {
  if (!session || session.closed) {
    return;
  }

  await new Promise<void>((resolve) => {
    session.waiters = session.waiters || [];
    session.waiters.push(resolve as () => void);
    try {
      session.process.kill(options.signal || 'SIGTERM');
    } catch {
      resolve();
      return;
    }
    setTimeout(() => {
      if (!session.closed) {
        try {
          session.process.kill('SIGKILL');
        } catch {
          // ignore
        }
      }
    }, options.forceAfter ?? 2000);
  });
}

export async function disposeSessionByKey(key: string): Promise<void> {
  const sessions = listSessionsForKey(key);
  if (sessions.length === 0) {
    return;
  }
  const tasks = sessions.map((session) => terminateSession(session).catch(() => {}));
  await Promise.allSettled(tasks);
  emitSessionsUpdate(serialiseSessions(listActiveSessions()));
}

export async function disposeSessionsForRepository(org: string, repo: string): Promise<void> {
  if (!org || !repo) {
    return;
  }
  const targets: TerminalSession[] = [];
  terminalSessionsById.forEach((session) => {
    if (!session || session.closed) {
      return;
    }
    if (session.org === org && session.repo === repo) {
      targets.push(session);
    }
  });
  if (targets.length === 0) {
    return;
  }
  const tasks = targets.map((session) => terminateSession(session).catch(() => {}));
  await Promise.allSettled(tasks);
  emitSessionsUpdate(serialiseSessions(listActiveSessions()));
}

export async function disposeSessionById(sessionId: string): Promise<void> {
  const session = terminalSessionsById.get(sessionId);
  if (!session) {
    return;
  }
  await terminateSession(session);
  emitSessionsUpdate(serialiseSessions(listActiveSessions()));
}

export async function disposeAllSessions(): Promise<void> {
  const activeSessions = Array.from(terminalSessionsById.values());
  if (activeSessions.length === 0) {
    return;
  }
  const closures = activeSessions.map((session) =>
    terminateSession(session, { signal: 'SIGTERM', forceAfter: 0 }).catch(() => {}),
  );
  await Promise.allSettled(closures);
  terminalSessions.clear();
  terminalSessionsById.clear();
  stopIdleMonitorIfInactive();
  emitSessionsUpdate([]);
}

export function getSessionById(sessionId: string): TerminalSession | undefined {
  return terminalSessionsById.get(sessionId);
}

export function listActiveSessions(): TerminalSession[] {
  return Array.from(terminalSessionsById.values()).filter((session) => session && !session.closed);
}

export function addSocketWatcher(session: TerminalSession, socket: unknown): void {
  const ws = socket as { on: (event: string, handler: () => void) => void };
  const watcher = { socket: ws as never };
  session.watchers.add(watcher);
  ws.on('close', () => {
    session.watchers.delete(watcher);
  });
}

async function spawnTerminalProcess({
  workdir,
  org,
  repo,
  branch,
  useTmux,
  requireTmux = false,
}: {
  workdir: string;
  org: string;
  repo: string;
  branch: string;
  useTmux?: boolean;
  requireTmux?: boolean;
}) {
  const { worktreePath } = await getWorktreePath(workdir, org, repo, branch);
  const shellCommand = process.env['SHELL'] || '/bin/bash';
  const args = determineShellArgs(shellCommand);

  let child;
  let usingTmux = false;
  let tmuxSessionName = null;
  let tmuxSessionExists = false;
  const baseEnv: Record<string, string | undefined> = {
    ...process.env,
    TERM: process.env['TERM'] || 'xterm-256color',
  };
  if (baseEnv['TMUX']) {
    delete baseEnv['TMUX'];
  }
  if (baseEnv['TMUX_PANE']) {
    delete baseEnv['TMUX_PANE'];
  }

  if (useTmux) {
    await detectTmux();
    if (isTmuxAvailable()) {
      tmuxSessionName = makeTmuxSessionName(org, repo, branch);
      tmuxSessionExists = await tmuxHasSession(tmuxSessionName);
      const tmuxArgs = tmuxSessionExists
        ? ['attach-session', '-t', tmuxSessionName]
        : ['new-session', '-s', tmuxSessionName, '-x', '120', '-y', '36'];

      if (!tmuxSessionExists) {
        // Keep the tmux client attached so the PTY stays open on first launch.
        tmuxArgs.push(shellCommand);
        if (args.length > 0) {
          tmuxArgs.push(...args);
        }
      }

      const tmuxEnv = { ...baseEnv };

      child = pty.spawn(TMUX_BIN, tmuxArgs, {
        cwd: worktreePath,
        env: tmuxEnv,
        cols: 120,
        rows: 36,
      });
      usingTmux = true;
    } else if (requireTmux) {
      throw new Error(
        'tmux is required for terminal sessions but was not detected on PATH. Install tmux or start the server with --no-tmux.',
      );
    }
  }

  if (!child) {
    child = pty.spawn(shellCommand, args, {
      cwd: worktreePath,
      env: baseEnv,
      cols: 120,
      rows: 36,
    });
  }

  return {
    child,
    usingTmux,
    tmuxSessionName,
    tmuxSessionExists,
    worktreePath,
  };
}

async function createTerminalSession(
  workdir: string,
  org: string,
  repo: string,
  branch: string,
  options: { useTmux?: boolean; kind?: string; requireTmux?: boolean } = {}
): Promise<TerminalSession> {
  const { useTmux = true, kind = 'interactive', requireTmux = false } = options;
  const key = makeSessionKey(org, repo, branch);
  const { child, usingTmux, tmuxSessionName, worktreePath } =
    await spawnTerminalProcess({ workdir, org, repo, branch, useTmux, requireTmux });

  const session: TerminalSession = {
    id: randomUUID(),
    key,
    org,
    repo,
    branch,
    process: child,
    worktreePath,
    usingTmux,
    tmuxSessionName,
    log: '',
    watchers: new Set(),
    closed: false,
    waiters: [],
    pendingInputs: [],
    ready: false,
    readyTimer: null,
    kind: kind as never,
    lastActivityAt: Date.now(),
    idle: false,
  };

  addSession(session);

  const ptyProcess = child as unknown as { on: (event: string, handler: (...args: unknown[]) => void) => void };
  ptyProcess.on('data', (...args: unknown[]) => {
    const chunk = args[0] as Buffer | string;
    handleSessionOutput(session, chunk);
  });
  ptyProcess.on('exit', (...args: unknown[]) => {
    const code = args[0] as number | null;
    const signal = args[1] as string | null;
    handleSessionExit(session, code || 0, signal || '');
  });
  session.readyTimer = setTimeout(() => {
    markSessionReady(session);
  }, 150);

  emitSessionsUpdate(serialiseSessions(listActiveSessions()));

  return session;
}

export async function getOrCreateTerminalSession(
  workdir: string,
  org: string,
  repo: string,
  branch: string,
  options: { mode?: string } = {}
) {
  const rawMode = typeof options['mode'] === 'string' ? options['mode'].toLowerCase() : 'auto';
  const mode = rawMode === 'tmux' || rawMode === 'pty' ? rawMode : 'auto';
  const allowTmuxSessions = mode !== 'pty';
  const allowPlainSessions = mode !== 'tmux';
  const requireTmux = mode === 'tmux';

  const key = makeSessionKey(org, repo, branch);
  const bucket = getSessionBucket(key);
  let automationCandidate = null;
  if (bucket) {
    for (const session of bucket.values()) {
      if (!session || session.closed) {
        continue;
      }
      if (session.kind && session.kind !== 'interactive') {
        if (!automationCandidate && session.kind === 'automation') {
          automationCandidate = session;
        }
        continue;
      }
      const sessionUsesTmux = Boolean(session.usingTmux);
      if (!session.kind) {
        if (!sessionUsesTmux) {
          if (mode === 'pty') {
            return { session, created: false };
          }
          continue;
        }
        if (!allowTmuxSessions) {
          continue;
        }
        return { session, created: false };
      }
      if (session.kind === 'interactive') {
        if (sessionUsesTmux) {
          if (!allowTmuxSessions) {
            continue;
          }
          return { session, created: false };
        }
        if (!allowPlainSessions) {
          continue;
        }
        return { session, created: false };
      }
    }
  }
  if (automationCandidate) {
    return { session: automationCandidate, created: false };
  }
  if (allowTmuxSessions) {
    return createTerminalSession(workdir, org, repo, branch, {
      useTmux: true,
      kind: 'interactive',
      requireTmux,
    });
  }
  return createTerminalSession(workdir, org, repo, branch, {
    useTmux: false,
    kind: 'interactive',
  });
}

export async function createIsolatedTerminalSession(
  workdir: string,
  org: string,
  repo: string,
  branch: string
): Promise<TerminalSession> {
  return createTerminalSession(workdir, org, repo, branch, {
    useTmux: false,
    kind: 'automation',
  });
}

import { promisify } from 'node:util';
import { execFile } from 'node:child_process';

const execFileAsync = promisify(execFile);

type GitRepositoryTestOverrides = {
  execFileAsync?: typeof execFileAsync;
} | null;

let gitRepositoryTestOverrides: GitRepositoryTestOverrides = null;

function resolveExecFileAsync(): typeof execFileAsync {
  return gitRepositoryTestOverrides?.execFileAsync ?? execFileAsync;
}

export function __setGitRepositoryTestOverrides(overrides?: {
  execFileAsync?: typeof execFileAsync;
}): void {
  gitRepositoryTestOverrides = overrides ?? null;
}

/**
 * Default buffer sizes for git operations
 */
export const GIT_BUFFER_SIZES = {
  SMALL: 1024 * 64,          // 64 KB - for simple commands
  MEDIUM: 1024 * 1024,       // 1 MB - for most operations
  LARGE: 1024 * 1024 * 4,    // 4 MB - for diffs
  XLARGE: 1024 * 1024 * 16,  // 16 MB - for init commands
} as const;

export interface GitCommandOptions {
  cwd?: string;
  maxBuffer?: number;
  env?: NodeJS.ProcessEnv;
  repositoryPath?: string | null;
}

export interface GitCommandResult {
  stdout: string;
  stderr: string;
}

/**
 * Custom error for git operations
 */
export class GitCommandError extends Error {
  public readonly command: string;
  public readonly args: string[];
  public readonly repositoryPath: string | null;
  public readonly stderr: string;
  public readonly stdout: string;

  constructor(command: string, args: string[], originalError: unknown, repositoryPath: string | null = null) {
    const error = originalError as { stderr?: Buffer | string; stdout?: Buffer | string; message?: string };
    const stderr = error?.stderr ? error.stderr.toString().trim() : '';
    const stdout = error?.stdout ? error.stdout.toString().trim() : '';
    const message = stderr || stdout || error?.message || 'Unknown git error';

    super(message);
    this.name = 'GitCommandError';
    this.command = command;
    this.args = args;
    this.repositoryPath = repositoryPath;
    this.stderr = stderr;
    this.stdout = stdout;

    if (originalError instanceof Error) {
      this.cause = originalError;
    }

    Error.captureStackTrace(this, this.constructor);
  }

  override toString(): string {
    return `GitCommandError: ${this.message} (git ${this.args?.join(' ') || ''})`;
  }
}

/**
 * Executes a git command with standard error handling
 * @param args - Git command arguments (without 'git' itself)
 * @param options - Execution options
 * @returns Command result with stdout and stderr
 * @throws {GitCommandError}
 */
export async function executeGitCommand(
  args: string[],
  options: GitCommandOptions = {}
): Promise<GitCommandResult> {
  const {
    cwd,
    maxBuffer = GIT_BUFFER_SIZES.MEDIUM,
    env = process.env,
    repositoryPath = null,
  } = options;

  const execImpl = resolveExecFileAsync();

  try {
    const result = await execImpl('git', args, {
      cwd,
      maxBuffer,
      env: { ...env },
    });
    return result;
  } catch (error: unknown) {
    throw new GitCommandError('git', args, error, repositoryPath);
  }
}

/**
 * Executes a git command in a specific repository directory
 * @param repositoryPath - Path to the repository
 * @param commandArgs - Git command arguments (after -C flag)
 * @param options - Additional options
 * @returns Command result
 */
export async function executeGitCommandInRepo(
  repositoryPath: string,
  commandArgs: string[],
  options: Omit<GitCommandOptions, 'repositoryPath'> = {}
): Promise<GitCommandResult> {
  const args = ['-C', repositoryPath, ...commandArgs];
  return executeGitCommand(args, {
    ...options,
    repositoryPath,
  });
}

/**
 * Extracts error message from a git error
 * @param error - The error object
 * @param fallback - Fallback message if extraction fails
 * @returns Error message
 */
export function extractGitErrorMessage(error: unknown, fallback: string = 'Unknown git error'): string {
  if (error instanceof GitCommandError) {
    return error.message;
  }

  const err = error as { stderr?: Buffer | string; stdout?: Buffer | string; message?: string };
  const stderr = err?.stderr ? err.stderr.toString().trim() : '';
  const stdout = err?.stdout ? err.stdout.toString().trim() : '';
  return (stderr || stdout || err?.message || fallback).trim();
}

/**
 * Checks if a git error indicates a "not found" condition
 * @param error - The error to check
 * @returns True if error indicates not found
 */
export function isNotFoundError(error: unknown): boolean {
  const message = extractGitErrorMessage(error, '');
  return /not found|does not exist|no such/i.test(message);
}

/**
 * Checks if a git error indicates a conflict
 * @param error - The error to check
 * @returns True if error indicates conflict
 */
export function isConflictError(error: unknown): boolean {
  const message = extractGitErrorMessage(error, '');
  return /conflict|already exists/i.test(message);
}

import fs from 'node:fs/promises';
import path from 'node:path';
import {
  executeGitCommandInRepo,
  extractGitErrorMessage,
  GIT_BUFFER_SIZES,
} from './git-repository.js';
import { normalizeBranchName, deriveWorktreeFolderName } from '../domain/index.js';
import { resolveDefaultBranch } from '../core/default-branch.js';
import {
  getRepositoryInitCommand,
} from '../core/repository-config.js';

/**
 * Custom error for worktree operations
 */
export class GitWorktreeError extends Error {
  public readonly repositoryPath: string;

  constructor(repositoryPath: string, message: string, cause?: Error | unknown) {
    super(`Failed to list worktrees for ${repositoryPath}: ${message}`);
    this.name = 'GitWorktreeError';
    this.repositoryPath = repositoryPath;
    if (cause) {
      this.cause = cause;
    }
  }
}

export interface WorktreeEntry {
  path: string | null;
  branch: string | null;
}

/**
 * Lists all worktrees for a repository
 * @param repositoryPath - Path to the repository
 * @returns Array of {path, branch} objects
 * @throws {GitWorktreeError}
 */
export async function listWorktrees(repositoryPath: string): Promise<WorktreeEntry[]> {
  try {
    const { stdout } = await executeGitCommandInRepo(
      repositoryPath,
      ['worktree', 'list', '--porcelain'],
      { maxBuffer: GIT_BUFFER_SIZES.MEDIUM }
    );

    if (!stdout.trim()) {
      return [];
    }

    const worktrees: WorktreeEntry[] = [];
    const blocks = stdout.trim().split(/\n\n+/);

    blocks.forEach((block) => {
      let worktreePath = null;
      let branchName = null;

      block.split('\n').forEach((line) => {
        if (line.startsWith('worktree ')) {
          worktreePath = line.slice('worktree '.length).trim();
        } else if (line.startsWith('branch ')) {
          const ref = line.slice('branch '.length).trim();
          branchName = ref.replace(/^refs\/heads\//, '');
        }
      });

      worktrees.push({ path: worktreePath, branch: branchName });
    });

    return worktrees;
  } catch (error) {
    const message = extractGitErrorMessage(error);
    console.error(
      `[agentrix] Failed to list worktrees for ${repositoryPath}: ${message}`
    );
    throw new GitWorktreeError(repositoryPath, message, error);
  }
}

/**
 * Counts local worktrees (optionally excluding main)
 * @param repositoryPath - Path to the repository
 * @param options - Options
 * @returns Count of worktrees
 */
export async function countLocalWorktrees(
  repositoryPath: string,
  { includeMain = false }: { includeMain?: boolean } = {}
): Promise<number> {
  const worktrees = await listWorktrees(repositoryPath);
  return worktrees.reduce((total, entry) => {
    if (!entry || typeof entry.branch !== 'string') {
      return total;
    }
    if (!includeMain && entry.branch === 'main') {
      return total;
    }
    return total + 1;
  }, 0);
}

/**
 * Checks if a branch exists in the repository
 * @param repositoryPath - Path to the repository
 * @param branch - Branch name
 * @returns True if branch exists
 */
async function branchExists(repositoryPath: string, branch: string): Promise<boolean> {
  try {
    await executeGitCommandInRepo(
      repositoryPath,
      ['rev-parse', '--verify', `refs/heads/${branch}`],
      { maxBuffer: GIT_BUFFER_SIZES.MEDIUM }
    );
    return true;
  } catch {
    return false;
  }
}

export interface InitCommandResult {
  ran: boolean;
  command: string;
}

/**
 * Runs the repository init command in a worktree
 * @param repoRoot - Repository root directory
 * @param worktreePath - Path to the worktree
 * @returns Init command result
 */
async function internalRunRepositoryInitCommand(repoRoot: string, worktreePath: string): Promise<InitCommandResult> {
  let initCommand = '';
  try {
    initCommand = await getRepositoryInitCommand(repoRoot);
  } catch (error: unknown) {
    const err = error as { message?: string };
    console.warn(
      `[agentrix] Failed to read repository config for ${repoRoot}:`,
      err?.message || error
    );
    initCommand = '';
  }

  if (!initCommand) {
    return { ran: false, command: '' };
  }

  const candidateShell = typeof process.env['SHELL'] === 'string' ? process.env['SHELL'].trim() : '';
  const shell = candidateShell || '/bin/sh';
  const shellName = path.basename(shell);
  const shellArgs = ['-l', '-c', initCommand];

  if (['bash', 'zsh', 'fish'].includes(shellName)) {
    shellArgs.splice(1, 0, '-i');
  }

  try {
    const { execFile } = await import('node:child_process');
    const { promisify } = await import('node:util');
    const execFileAsync = promisify(execFile);

    await execFileAsync(shell, shellArgs, {
      cwd: worktreePath,
      maxBuffer: GIT_BUFFER_SIZES.XLARGE,
      env: { ...process.env },
    });
    return { ran: true, command: initCommand };
  } catch (error: unknown) {
    const err = error as { stderr?: Buffer | string; stdout?: Buffer | string; message?: string };
    const stderr = err?.stderr ? err.stderr.toString() : '';
    const stdout = err?.stdout ? err.stdout.toString() : '';
    const details = stderr || stdout || err?.message || 'Unknown repository init error';
    throw new Error(`Repository init command failed: ${details.trim()}`);
  }
}

let runRepositoryInitCommandImpl: typeof internalRunRepositoryInitCommand = internalRunRepositoryInitCommand;

async function runRepositoryInitCommand(
  repoRoot: string,
  worktreePath: string
): Promise<InitCommandResult> {
  return await runRepositoryInitCommandImpl(repoRoot, worktreePath);
}

export function __setWorktreeRepositoryTestOverrides(overrides?: {
  runRepositoryInitCommand?: typeof internalRunRepositoryInitCommand;
}): void {
  runRepositoryInitCommandImpl = overrides?.runRepositoryInitCommand ?? internalRunRepositoryInitCommand;
}

export interface CreateWorktreeOptions {
  defaultBranchOverride?: string;
  progress?: unknown;
}

/**
 * Creates a new worktree
 * @param workdir - Work directory root
 * @param org - Organization name
 * @param repo - Repository name
 * @param branch - Branch name
 * @param options - Options
 */
export async function createWorktree(
  workdir: string,
  org: string,
  repo: string,
  branch: string,
  options: CreateWorktreeOptions = {}
): Promise<void> {
  const { defaultBranchOverride, progress } = options || {};
  const branchName = normalizeBranchName(branch);

  if (!branchName) {
    throw new Error('Branch name cannot be empty');
  }

  // We need to import ensureRepository from repository-repository
  // For now, construct paths directly
  const repoRoot = path.join(workdir, org, repo);
  const repositoryPath = path.join(repoRoot, 'repository');

  const folderName = deriveWorktreeFolderName(branchName);
  const targetPath = path.join(repoRoot, folderName);

  try {
    await fs.access(targetPath);
    throw new Error(`Worktree directory already exists at ${targetPath}`);
  } catch (error: unknown) {
    const err = error as { code?: string };
    if (!err || err.code !== 'ENOENT') {
      throw error;
    }
  }

  const describeError = (error: unknown, fallback: string = 'Unknown git error'): string => {
    return extractGitErrorMessage(error, fallback);
  };

  const prog = progress as {
    ensureStep?: (id: string, label: string) => void;
    startStep?: (id: string, options: { label: string; message: string }) => void;
    completeStep?: (id: string, options: { label: string; message: string }) => void;
    failStep?: (id: string, options: { label: string; message: string }) => void;
    skipStep?: (id: string, options: { label: string; message: string }) => void;
    logStep?: (id: string, message: string) => void;
  } | undefined;

  prog?.ensureStep?.('sync-default-branch', 'Sync default branch');
  prog?.ensureStep?.('create-worktree', 'Create worktree');
  prog?.ensureStep?.('run-init-script', 'Run init script');

  prog?.startStep?.('sync-default-branch', {
    label: 'Sync default branch',
    message: 'Preparing repository and syncing default branch.',
  });

  let defaultBranch = '';
  try {
    defaultBranch = await resolveDefaultBranch(repositoryPath, {
      override: defaultBranchOverride,
    });
    if (defaultBranch) {
      prog?.logStep?.('sync-default-branch', `Resolved default branch: ${defaultBranch}`);
    }
    await executeGitCommandInRepo(repositoryPath, ['checkout', defaultBranch]);
    prog?.logStep?.('sync-default-branch', `Checked out default branch ${defaultBranch}.`);

    await executeGitCommandInRepo(repositoryPath, [
      'pull',
      '--ff-only',
      'origin',
      defaultBranch,
    ]);

    prog?.completeStep?.('sync-default-branch', {
      label: 'Sync default branch',
      message: `Default branch ${defaultBranch} is up to date.`,
    });
  } catch (error) {
    const message = describeError(error);
    prog?.failStep?.('sync-default-branch', {
      label: 'Sync default branch',
      message,
    });
    throw new Error(`Failed to create worktree: ${message}`);
  }

  prog?.startStep?.('create-worktree', {
    label: 'Create worktree',
    message: `Adding worktree at ${targetPath}`,
  });

  let worktreeAdded = false;
  try {
    const exists = await branchExists(repositoryPath, branchName);
    const args = ['worktree', 'add'];
    if (!exists) {
      args.push('-b', branchName);
    }
    args.push(targetPath);
    if (exists) {
      args.push(branchName);
    }
    await executeGitCommandInRepo(repositoryPath, args);
    worktreeAdded = true;
    prog?.completeStep?.('create-worktree', {
      label: 'Create worktree',
      message: exists
        ? `Attached existing branch ${branchName} to ${targetPath}.`
        : `Created new branch ${branchName} at ${targetPath}.`,
    });
  } catch (error) {
    const message = describeError(error);
    prog?.failStep?.('create-worktree', {
      label: 'Create worktree',
      message,
    });
    throw new Error(`Failed to create worktree: ${message}`);
  }

  prog?.startStep?.('run-init-script', {
    label: 'Run init script',
    message: 'Checking for repository init command.',
  });

  try {
    const initResult = await runRepositoryInitCommand(repoRoot, targetPath);
    if (!initResult?.ran) {
      prog?.skipStep?.('run-init-script', {
        label: 'Run init script',
        message: 'No init command configured for this repository.',
      });
    } else {
      prog?.completeStep?.('run-init-script', {
        label: 'Run init script',
        message: 'Init command completed successfully.',
      });
    }
  } catch (error) {
    const message = describeError(error, 'Repository init command failed');
    prog?.failStep?.('run-init-script', {
      label: 'Run init script',
      message,
    });
    if (worktreeAdded) {
      try {
        await executeGitCommandInRepo(repositoryPath, [
          'worktree',
          'remove',
          '--force',
          targetPath,
        ]);
      } catch (cleanupError: unknown) {
        const cleanupErr = cleanupError as { message?: string };
        console.warn(
          `[agentrix] Failed to clean up worktree at ${targetPath} after init command failure:`,
          cleanupErr?.message || cleanupError
        );
      }
    }
    throw new Error(`Failed to create worktree: ${message}`);
  }
}

export interface WorktreePathResult {
  repositoryPath: string;
  worktreePath: string;
}

/**
 * Gets the path to a worktree for a specific branch
 * @param workdir - Work directory root
 * @param org - Organization name
 * @param repo - Repository name
 * @param branch - Branch name
 * @returns Worktree paths
 */
export async function getWorktreePath(
  workdir: string,
  org: string,
  repo: string,
  branch: string
): Promise<WorktreePathResult> {
  const repositoryPath = path.join(workdir, org, repo, 'repository');
  const worktrees = await listWorktrees(repositoryPath);
  const match = worktrees.find((item) => item.branch === branch);

  if (!match || !match.path) {
    throw new Error(`Worktree for ${org}/${repo} branch ${branch} not found`);
  }

  return { repositoryPath, worktreePath: match.path };
}

/**
 * Removes a worktree
 * @param workdir - Work directory root
 * @param org - Organization name
 * @param repo - Repository name
 * @param branch - Branch name
 */
export async function removeWorktree(
  workdir: string,
  org: string,
  repo: string,
  branch: string
): Promise<void> {
  const branchName = normalizeBranchName(branch);

  if (!branchName) {
    throw new Error('Branch name cannot be empty');
  }

  if (branchName.toLowerCase() === 'main') {
    throw new Error('Cannot remove the main worktree');
  }

  const repositoryPath = path.join(workdir, org, repo, 'repository');
  const worktrees = await listWorktrees(repositoryPath);
  const entry = worktrees.find((item) => item.branch === branchName);

  if (!entry || !entry.path) {
    return;
  }

  try {
    await executeGitCommandInRepo(repositoryPath, [
      'worktree',
      'remove',
      '--force',
      entry.path,
    ]);
  } catch (error) {
    const message = extractGitErrorMessage(error);
    throw new Error(`Failed to remove worktree: ${message}`);
  }
}

