import { promisify } from 'node:util';
import * as childProcess from 'node:child_process';

const execFileAsync = promisify(childProcess.execFile);

export interface DefaultBranchOptions {
  remote?: string;
  override?: string;
}

export interface DefaultBranchConfig {
  global?: string;
  overrides?: Record<string, string>;
  repositories?: Record<string, string>;
}

function parseRef(value: string | null): string | null {
  if (!value || typeof value !== 'string') {
    return null;
  }
  const trimmed = value.trim();
  const match = trimmed.match(/refs\/heads\/(.+)$/);
  return match ? match[1]! : trimmed || null;
}

export async function resolveDefaultBranch(
  repositoryPath: string,
  { remote = 'origin', override }: DefaultBranchOptions = {}
): Promise<string> {
  if (override && typeof override === 'string' && override.trim()) {
    return override.trim();
  }

  try {
    const { stdout } = await execFileAsync('git', ['-C', repositoryPath, 'symbolic-ref', 'HEAD'], {
      maxBuffer: 1024 * 1024,
    });
    const headBranch = parseRef(stdout);
    if (headBranch) {
      return headBranch;
    }
  } catch {
    // fall through to remote inspection
  }

  try {
    const { stdout } = await execFileAsync('git', ['remote', 'show', remote], {
      cwd: repositoryPath,
      maxBuffer: 1024 * 1024,
    });
    const lines = stdout.split('\n');
    for (const line of lines) {
      const trimmed = line.trim();
      if (!trimmed.toLowerCase().startsWith('head branch:')) {
        continue;
      }
      const branch = trimmed.slice('head branch:'.length).trim();
      if (branch && branch.toLowerCase() !== '(unknown)') {
        return branch;
      }
    }
  } catch {
    // fall through
  }

  return 'main';
}

export function selectDefaultBranchOverride(
  config: DefaultBranchConfig | unknown,
  org: string,
  repo: string
): string | undefined {
  if (!config) {
    return undefined;
  }
  const cfg = config as DefaultBranchConfig;
  const { overrides, repositories, global } = cfg;

  // Try repository-specific override first
  if (repositories && typeof repositories === 'object') {
    const key = `${org}/${repo}`;
    const value = repositories[key];
    if (typeof value === 'string' && value.trim()) {
      return value.trim();
    }
  }

  // Try legacy overrides format
  if (overrides && typeof overrides === 'object') {
    const key = `${org}/${repo}`;
    const value = overrides[key];
    if (typeof value === 'string' && value.trim()) {
      return value.trim();
    }
  }

  // Fall back to global default
  if (typeof global === 'string' && global.trim()) {
    return global.trim();
  }

  return undefined;
}

/**
 * Git URL parsing utilities
 */

export interface GitUrlParts {
  org: string;
  repo: string;
  url: string;
}

/**
 * Parses a Git repository URL into org and repo components
 * @param input - Repository URL (SSH, HTTPS, or path format)
 * @returns Object with {org, repo, url} properties
 * @throws {Error} If URL cannot be parsed
 */
export function parseRepositoryUrl(input: string): GitUrlParts {
  if (typeof input !== 'string' || !input.trim()) {
    throw new Error('Repository URL is required');
  }

  const trimmed = input.trim();
  let org = '';
  let repo = '';

  // Try SSH format: git@github.com:org/repo.git
  const sshMatch = trimmed.match(/^git@[^:]+:([^/]+)\/(.+)$/);
  if (sshMatch) {
    org = sshMatch[1]!;
    repo = sshMatch[2]!;
  } else {
    // Try HTTPS/HTTP URL format
    try {
      if (/^[a-z]+:\/\//i.test(trimmed)) {
        const url = new URL(trimmed);
        const parts = url.pathname.replace(/^\//, '').split('/').filter(Boolean);
        if (parts.length >= 2) {
          org = parts[parts.length - 2]!;
          repo = parts[parts.length - 1]!;
        }
      }
    } catch {
      // ignore URL parsing errors and fall back to manual parsing
    }

    // If not parsed yet, try path-like format
    if (!org || !repo) {
      const cleaned = trimmed.replace(/\.git$/, '');
      const segments = cleaned.split(/[\\/]+/).filter(Boolean);
      if (segments.length >= 2) {
        org = segments[segments.length - 2]!;
        repo = segments[segments.length - 1]!;
      }
    }

    // Try colon-separated format (alternate SSH style)
    if ((!org || !repo) && trimmed.includes(':')) {
      const tail = trimmed.split(':').pop() || '';
      const segments = tail.replace(/\.git$/, '').split('/').filter(Boolean);
      if (segments.length >= 2) {
        org = segments[segments.length - 2]!;
        repo = segments[segments.length - 1]!;
      }
    }
  }

  // Remove .git extension from repo name
  repo = repo ? repo.replace(/\.git$/, '') : repo;

  if (!org || !repo) {
    throw new Error('Unable to determine repository organisation and name from URL');
  }

  return { org, repo, url: trimmed };
}

/**
 * Value object representing a parsed Git URL
 */
export class GitUrl {
  public readonly org: string;
  public readonly repo: string;
  public readonly url: string;

  constructor(url: string) {
    const parsed = parseRepositoryUrl(url);
    this.org = parsed.org;
    this.repo = parsed.repo;
    this.url = parsed.url;
  }

  toString(): string {
    return this.url;
  }

  toIdentifier(): string {
    return `${this.org}/${this.repo}`;
  }
}

/**
 * Branch name validation and normalization
 */

/**
 * Normalizes a branch name by trimming whitespace
 * @param branch - Branch name to normalize
 * @returns Normalized branch name
 */
export function normalizeBranchName(branch: unknown): string {
  if (typeof branch !== 'string') {
    return '';
  }
  return branch.trim();
}

/**
 * Sanitizes a branch name (alias for normalizeBranchName for clarity)
 * @param branch - Branch name to sanitize
 * @returns Sanitized branch name
 */
export function sanitizeBranchName(branch: unknown): string {
  return normalizeBranchName(branch);
}

/**
 * Derives a worktree folder name from a branch name
 * Takes the last segment after splitting by '/'
 * @param branch - Branch name
 * @returns Folder name for the worktree
 * @throws {Error} If branch name is invalid or empty
 */
export function deriveWorktreeFolderName(branch: string): string {
  const trimmed = normalizeBranchName(branch);
  if (!trimmed) {
    throw new Error('Branch name cannot be empty');
  }
  const parts = trimmed.split('/').filter(Boolean);
  const folder = parts[parts.length - 1];
  if (!folder) {
    throw new Error('Unable to derive worktree folder from branch name');
  }
  return folder;
}

/**
 * Validates that a branch name is not empty
 * @param branch - Branch name to validate
 * @returns Validated branch name
 * @throws {Error} If branch name is invalid
 */
export function validateBranchName(branch: string): string {
  const normalized = normalizeBranchName(branch);
  if (!normalized) {
    throw new Error('Branch name cannot be empty');
  }
  return normalized;
}

/**
 * Value object representing a branch name
 */
export class BranchName {
  public readonly value: string;

  constructor(name: string) {
    this.value = validateBranchName(name);
  }

  toString(): string {
    return this.value;
  }

  /**
   * Gets the worktree folder name for this branch
   * @returns Folder name
   */
  toFolderName(): string {
    return deriveWorktreeFolderName(this.value);
  }

  /**
   * Checks if this is the main/default branch
   * @param defaultBranch - The default branch name (default: 'main')
   * @returns True if this is the default branch
   */
  isDefault(defaultBranch: string = 'main'): boolean {
    return this.value.toLowerCase() === defaultBranch.toLowerCase();
  }

  equals(other: BranchName | string): boolean {
    if (other instanceof BranchName) {
      return this.value === other.value;
    }
    return this.value === other;
  }
}

/**
 * Worktree domain entity
 */

export interface WorktreeData {
  path: string;
  branch: string;
  org: string;
  repo: string;
}

/**
 * Represents a Git worktree
 */
export class Worktree {
  public readonly path: string;
  public readonly branch: string;
  public readonly org: string;
  public readonly repo: string;

  constructor({ path, branch, org, repo }: WorktreeData) {
    this.path = path;
    this.branch = branch;
    this.org = org;
    this.repo = repo;
  }

  /**
   * Gets the unique key for this worktree
   * @returns Format: org::repo::branch
   */
  getKey(): string {
    return `${this.org}::${this.repo}::${this.branch}`;
  }

  /**
   * Gets the repository identifier
   * @returns Format: org/repo
   */
  getRepositoryId(): string {
    return `${this.org}/${this.repo}`;
  }

  /**
   * Checks if this is the main worktree
   * @param defaultBranch - The default branch name
   * @returns True if this is the main worktree
   */
  isMainWorktree(defaultBranch: string = 'main'): boolean {
    return typeof this.branch === 'string' && this.branch.toLowerCase() === defaultBranch.toLowerCase();
  }

  toJSON(): WorktreeData {
    return {
      path: this.path,
      branch: this.branch,
      org: this.org,
      repo: this.repo,
    };
  }
}

/**
 * Creates a worktree instance from raw data
 * @param data - Raw worktree data
 * @returns Worktree instance
 */
export function createWorktree(data: WorktreeData): Worktree {
  return new Worktree(data);
}

